import React, { useState } from "react";
import RatingQuestion from "../RatingQuestion";
import Results_TF from "../Results_TF";

const Sensing_vs_Intuition = () => {
  const questions = [
    {
      question:
        "You consider People First then The Facts when making decisions",
      answers: [
        { id: 0, thinking: 5, feeling: 1 },
        { id: 1, thinking: 4, feeling: 2 },
        { id: 2, thinking: 3, feeling: 3 },
        { id: 3, thinking: 2, feeling: 4 },
        { id: 4, thinking: 1, feeling: 5 },
      ],
    },
    {
      question: "You consider the Facts First the People when Making Decisions",
      answers: [
        { id: 0, thinking: 1, feeling: 5 },
        { id: 1, thinking: 2, feeling: 4 },
        { id: 2, thinking: 3, feeling: 3 },
        { id: 3, thinking: 4, feeling: 2 },
        { id: 4, thinking: 5, feeling: 1 },
      ],
    },
    {
      question:
        "You value what Other People Value more than what Other People Think",
      answers: [
        { id: 0, thinking: 5, feeling: 1 },
        { id: 1, thinking: 4, feeling: 2 },
        { id: 2, thinking: 3, feeling: 3 },
        { id: 3, thinking: 2, feeling: 4 },
        { id: 4, thinking: 1, feeling: 5 },
      ],
    },
    {
      question:
        "You value what Other People Think more than what Other People Value",
      answers: [
        { id: 0, thinking: 1, feeling: 5 },
        { id: 1, thinking: 2, feeling: 4 },
        { id: 2, thinking: 3, feeling: 3 },
        { id: 3, thinking: 4, feeling: 2 },
        { id: 4, thinking: 5, feeling: 1 },
      ],
    },
    {
      question:
        "You consider what is Good and Bad when making decisions more than what is True or False",
      answers: [
        { id: 0, thinking: 5, feeling: 1 },
        { id: 1, thinking: 4, feeling: 2 },
        { id: 2, thinking: 3, feeling: 3 },
        { id: 3, thinking: 2, feeling: 4 },
        { id: 4, thinking: 1, feeling: 5 },
      ],
    },
    {
      question:
        "You consider what is True and False when making decisions more than what is Good or Bad",
      answers: [
        { id: 0, thinking: 1, feeling: 5 },
        { id: 1, thinking: 2, feeling: 4 },
        { id: 2, thinking: 3, feeling: 3 },
        { id: 3, thinking: 4, feeling: 2 },
        { id: 4, thinking: 5, feeling: 1 },
      ],
    },
    {
      question:
        "You would rather be Understanding and Warm rather than being Reasonable and Fair",
      answers: [
        { id: 0, thinking: 5, feeling: 1 },
        { id: 1, thinking: 4, feeling: 2 },
        { id: 2, thinking: 3, feeling: 3 },
        { id: 3, thinking: 2, feeling: 4 },
        { id: 4, thinking: 1, feeling: 5 },
      ],
    },
    {
      question:
        "You would rather be Reasonable and Fair rather than being Understanding and Warm",
      answers: [
        { id: 0, thinking: 1, feeling: 5 },
        { id: 1, thinking: 2, feeling: 4 },
        { id: 2, thinking: 3, feeling: 3 },
        { id: 3, thinking: 4, feeling: 2 },
        { id: 4, thinking: 5, feeling: 1 },
      ],
    },
    {
      question:
        "You rely on Your Own, Subjective Inner Valuse more than Objective Principles",
      answers: [
        { id: 0, thinking: 5, feeling: 1 },
        { id: 1, thinking: 4, feeling: 2 },
        { id: 2, thinking: 3, feeling: 3 },
        { id: 3, thinking: 2, feeling: 4 },
        { id: 4, thinking: 1, feeling: 5 },
      ],
    },
    {
      question:
        "You rely on Objective Principles more than Your Own, Subjective Inner Values",
      answers: [
        { id: 0, thinking: 1, feeling: 5 },
        { id: 1, thinking: 2, feeling: 4 },
        { id: 2, thinking: 3, feeling: 3 },
        { id: 3, thinking: 4, feeling: 2 },
        { id: 4, thinking: 5, feeling: 1 },
      ],
    },
    {
      question: "You Value Personal Relationships more than Competence",
      answers: [
        { id: 0, thinking: 5, feeling: 1 },
        { id: 1, thinking: 4, feeling: 2 },
        { id: 2, thinking: 3, feeling: 3 },
        { id: 3, thinking: 2, feeling: 4 },
        { id: 4, thinking: 1, feeling: 5 },
      ],
    },
    {
      question: "You Value Competence more than Personal Relationships",
      answers: [
        { id: 0, thinking: 1, feeling: 5 },
        { id: 1, thinking: 2, feeling: 4 },
        { id: 2, thinking: 3, feeling: 3 },
        { id: 3, thinking: 4, feeling: 2 },
        { id: 4, thinking: 5, feeling: 1 },
      ],
    },
    {
      question:
        "I think about the what’s going on - what happened and what something is.",
      answers: [
        { id: 0, thinking: 1, feeling: 5 },
        { id: 1, thinking: 2, feeling: 4 },
        { id: 2, thinking: 3, feeling: 3 },
        { id: 3, thinking: 4, feeling: 2 },
        { id: 4, thinking: 5, feeling: 1 },
      ],
    },
    {
      question:
        "I say things like ‘people should be more kind, empathetic and considerate’ more than I say things like ‘people should be truthful, logical and efficient as possible’",
      answers: [
        { id: 0, thinking: 10, feeling: 1 },
        { id: 1, thinking: 8, feeling: 3 },
        { id: 2, thinking: 5, feeling: 5 },
        { id: 3, thinking: 3, feeling: 8 },
        { id: 4, thinking: 1, feeling: 10 },
      ],
    },
    {
      question:
        "It makes you upset when people don’t acknowledge facts logic you believe to be true and lack of thought",
      answers: [
        { id: 0, thinking: 1, feeling: 10 },
        { id: 1, thinking: 3, feeling: 8 },
        { id: 2, thinking: 5, feeling: 5 },
        { id: 3, thinking: 8, feeling: 3 },
        { id: 4, thinking: 10, feeling: 1 },
      ],
    },
  ];

  const [currentQuestion, setCurrentQuestion] = useState(0);
  const [testOver, setTestOver] = useState(false);
  const [intuition, setIntuition] = useState(0);
  const [sensing, setSensing] = useState(0);
  const [result, setResult] = useState({
    intuition: 0,
    sensing: 0,
  });
  const [percentages, setPercentages] = useState({
    intuitionPercentage: 0,
    sensingPercentage: 0,
  });
  const values = [];

  const calculation = (n, s) => {
    setResult({
      intuition: intuition,
      sensing: sensing,
    });

    setCurrentQuestion(currentQuestion + 1);

    if (currentQuestion + 1 >= questions.length) {
      setTestOver(true);
      const n = (100 * intuition) / (result.intuition + result.sensing);
      const s = (100 * sensing) / (result.intuition + result.sensing);
      setPercentages({
        intuitionPercentage: n,
        sensingPercentage: s,
      });
    }
  };

  const getValue = (index) => {
    questions[currentQuestion].answers.forEach((e, i) => {
      if (e.id === index) {
        setIntuition(e.intuition);
        setSensing(e.sensing);
      }
    });
  };

  const startOver = () => {
    setIntuition(0);
    setSensing(0);
    setResult({
      intuition: 0,
      sensing: 0,
    });
    setTestOver(false);
    setCurrentQuestion(0);
  };

  return (
    <div className="page">
      <section className="test-section">
        <h1> Thinking vs Feeling </h1>
        <h4>Answer the following questions Honestly and Thoughtfully.</h4>
        {testOver ? (
          <div className="buttons">
            <h4>Let's see what you've got!</h4>
            <button>Submit Results</button>
            <button onClick={() => startOver()}>Start Over</button>
          </div>
        ) : (
          <div className="buttons">
            <h4> Let's do this!</h4>
            <button onClick={() => calculation()}>Next Question</button>
          </div>
        )}

        {!testOver ? (
          <RatingQuestion
            getValue={getValue}
            name={"s" + currentQuestion}
            id={currentQuestion}
            question={questions[currentQuestion].question}
          />
        ) : (
          <Results_TF
            intuitionPercentage={percentages.intuitionPercentage}
            sensingPercentage={percentages.sensingPercentage}
          />
        )}
      </section>
    </div>
  );
};

export default Sensing_vs_Intuition;
